import React, {useState} from "react";
import CocktailsList from "./ingredients";

function AddButton() {
    const [bar, setBar] = useState([])
    const [count, setCount] = useState(0)

    const addButton = () => {
        setCount(count + 1)
        bar.push(count);
        setBar(bar);
        console.log(bar);
    }
    return (
        <div>
            <div>
                <button className="button" onClick={addButton}>+</button>
            </div>
            <div>
                {bar.map((t) => (
                    <CocktailsList key={t}/>
                ))}
            </div>
        </div>
    )
}

export default AddButton
